import "core-js/modules/es.array.map";
//
//
//
import ContactPage from "~/components/pages/ContactPage";
export default {
  components: {
    ContactPage: ContactPage
  },
  data: function data() {
    return {
      breadcrumbs: [{
        url: process.env.APP_URL,
        text: this.$t("homepage")
      }, {
        url: process.env.APP_URL + this.$route.path,
        text: this.$t("atoms.links.contact")
      }]
    };
  },
  head: function head() {
    return {
      title: this.$t("pages.contact.title"),
      titleTemplate: "%s – " + this.$t("atoms.name")
    };
  },
  jsonld: function jsonld() {
    var items = this.breadcrumbs.map(function (item, index) {
      return {
        "@type": "ListItem",
        position: index + 1,
        item: {
          "@id": item.url,
          name: item.text
        }
      };
    });
    return {
      "@context": "http://schema.org",
      "@type": "BreadcrumbList",
      itemListElement: items
    };
  }
};
